import React from 'react';
import { Clock, CheckCircle, MoreHorizontal, ArrowRight } from 'lucide-react';

const OrderStatus = () => {
  // Sample orders data
  const orders = [
    {
      id: "ORD-2025-1234",
      date: "March 18, 2025",
      time: "12:45 PM",
      total: 43.96,
      status: "delivered",
      items: [
        { name: "Margherita Pizza", quantity: 1, price: 14.99 },
        { name: "Beef Burger", quantity: 2, price: 12.99 },
        { name: "Sparkling Water", quantity: 1, price: 2.99 }
      ],
      estimatedDelivery: "Delivered at 1:30 PM"
    },
    {
      id: "ORD-2025-1233",
      date: "March 17, 2025",
      time: "7:15 PM",
      total: 29.97,
      status: "preparing",
      items: [
        { name: "Spaghetti Bolognese", quantity: 1, price: 15.99 },
        { name: "Garlic Bread", quantity: 1, price: 5.99 },
        { name: "House Wine", quantity: 1, price: 8.99 }
      ],
      estimatedDelivery: "Estimated delivery: 30-45 minutes"
    }
  ];

  const getStatusClass = (status) => {
    switch (status) {
      case 'pending': return 'status-pending';
      case 'preparing': return 'status-preparing';
      case 'ready': return 'status-ready';
      case 'delivered': return 'status-delivered';
      default: return '';
    }
  };

  const getStatusText = (status) => {
    switch (status) {
      case 'pending': return 'Order Received';
      case 'preparing': return 'Preparing';
      case 'ready': return 'Ready for Pickup/Delivery';
      case 'delivered': return 'Delivered';
      default: return '';
    }
  };

  const getStatusIcon = (status) => {
    switch (status) {
      case 'pending': return <Clock size={16} />;
      case 'preparing': return <MoreHorizontal size={16} />;
      case 'ready': return <ArrowRight size={16} />;
      case 'delivered': return <CheckCircle size={16} />;
      default: return null;
    }
  };

  return (
    <div className="fade-in">
      <h2 className="text-2xl font-bold text-gray-800 mb-6">My Orders</h2>

      <div className="space-y-6">
        {orders.map((order) => (
          <div key={order.id} className="border border-gray-200 rounded-lg overflow-hidden">
            <div className="bg-gray-50 p-4 border-b border-gray-200">
              <div className="flex flex-wrap justify-between items-center">
                <div>
                  <p className="font-medium text-gray-800">{order.id}</p>
                  <p className="text-sm text-gray-600">{order.date} at {order.time}</p>
                </div>
                <div className="flex items-center">
                  <span className={`${getStatusClass(order.status)} flex items-center gap-1`}>
                    {getStatusIcon(order.status)}
                    {getStatusText(order.status)}
                  </span>
                </div>
              </div>
            </div>

            <div className="p-4">
              <div className="mb-4">
                <p className="text-sm text-gray-600 mb-2">{order.estimatedDelivery}</p>
                {order.status === 'preparing' && (
                  <div className="bg-gray-100 rounded-full h-2 overflow-hidden">
                    <div className="bg-orange-500 h-2 w-1/2"></div>
                  </div>
                )}
              </div>

              <div className="border-t border-gray-200 pt-4 mb-4">
                {order.items.map((item, index) => (
                  <div key={index} className="flex justify-between py-2">
                    <div>
                      <span className="font-medium">{item.quantity}x</span> {item.name}
                    </div>
                    <div>${(item.price * item.quantity).toFixed(2)}</div>
                     </div>
                ))}
              </div>

              <div className="border-t border-gray-200 pt-4 flex justify-between">
                <span className="font-semibold">Total</span>
                <span className="font-semibold">${order.total.toFixed(2)}</span>
              </div>

              <div className="mt-6 flex space-x-4">
                <button className="flex-1 btn btn-outline">View Details</button>
                {order.status === 'delivered' && (
                  <button className="flex-1 btn btn-primary">Reorder</button>
                )}
                {['pending', 'preparing'].includes(order.status) && (
                  <button className="flex-1 btn btn-outline text-red-600 border-red-600 hover:bg-red-600 hover:text-white">Cancel Order</button>
                )}
              </div>
            </div>
          </div>
        ))}
      </div>

      {orders.length === 0 && (
        <div className="text-center py-12">
          <div className="text-gray-400 mb-4">
            <svg className="mx-auto w-16 h-16" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M9 5H7a2 2 0 00-2 2v12a2 2 0 002 2h10a2 2 0 002-2V7a2 2 0 00-2-2h-2M9 5a2 2 0 002 2h2a2 2 0 002-2M9 5a2 2 0 012-2h2a2 2 0 012 2" />
            </svg>
          </div>
          <h3 className="text-xl font-medium text-gray-700 mb-2">No orders yet</h3>
          <p className="text-gray-500 mb-4">You haven't placed any orders yet.</p>
          <button className="btn btn-primary">Browse Menu</button>
        </div>
      )}
    </div>
  );
};

export default OrderStatus;
